import { useState } from 'react';
import { Card, Typography } from '@mui/material';
import { PieCharts } from '@mui/x-charts';
import Dashboard from './Dashboard';

export default function Matter() {
        const data = [
            {
              "country": "AD",
              "hot dog": 116,
              "hot dogColor": "hsl(147, 70%, 50%)",
              "burger": 192,
              "burgerColor": "hsl(70, 70%, 50%)",
              "sandwich": 9,
              "sandwichColor": "hsl(94, 70%, 50%)",
              "kebab": 42,
              "kebabColor": "hsl(115, 70%, 50%)",
              "fries": 12,
              "friesColor": "hsl(155, 70%, 50%)",
              "donut": 195,
              "donutColor": "hsl(189, 70%, 50%)"
            },
            {
              "country": "AE",
              "hot dog": 24,
              "hot dogColor": "hsl(34, 70%, 50%)",
              "burger": 115,
              "burgerColor": "hsl(27, 70%, 50%)",
              "sandwich": 99,
              "sandwichColor": "hsl(101, 70%, 50%)",
              "kebab": 169,
              "kebabColor": "hsl(202, 70%, 50%)",
              "fries": 133,
              "friesColor": "hsl(322, 70%, 50%)",
              "donut": 38,
              "donutColor": "hsl(340, 70%, 50%)"
            },
            {
              "country": "AF",
              "hot dog": 179,
              "hot dogColor": "hsl(130, 70%, 50%)",
              "burger": 16,
              "burgerColor": "hsl(229, 70%, 50%)",
              "sandwich": 156,
              "sandwichColor": "hsl(22, 70%, 50%)",
              "kebab": 116,
              "kebabColor": "hsl(284, 70%, 50%)",
              "fries": 109,
              "friesColor": "hsl(111, 70%, 50%)",
              "donut": 152,
              "donutColor": "hsl(39, 70%, 50%)"
            },
            {
              "country": "AG",
              "hot dog": 36,
              "hot dogColor": "hsl(292, 70%, 50%)",
              "burger": 146,
              "burgerColor": "hsl(85, 70%, 50%)",
              "sandwich": 24,
              "sandwichColor": "hsl(46, 70%, 50%)",
              "kebab": 44,
              "kebabColor": "hsl(248, 70%, 50%)",
              "fries": 156,
              "friesColor": "hsl(179, 70%, 50%)",
              "donut": 124,
              "donutColor": "hsl(225, 70%, 50%)"
            },
            {
              "country": "AI",
              "hot dog": 181,
              "hot dogColor": "hsl(113, 70%, 50%)",
              "burger": 70,
              "burgerColor": "hsl(83, 70%, 50%)",
              "sandwich": 122,
              "sandwichColor": "hsl(272, 70%, 50%)",
              "kebab": 22,
              "kebabColor": "hsl(216, 70%, 50%)",
              "fries": 68,
              "friesColor": "hsl(356, 70%, 50%)",
              "donut": 42,
              "donutColor": "hsl(181, 70%, 50%)"
            },
            {
              "country": "AL",
              "hot dog": 6,
              "hot dogColor": "hsl(3, 70%, 50%)",
              "burger": 84,
              "burgerColor": "hsl(322, 70%, 50%)",
              "sandwich": 35,
              "sandwichColor": "hsl(293, 70%, 50%)",
              "kebab": 170,
              "kebabColor": "hsl(336, 70%, 50%)",
              "fries": 150,
              "friesColor": "hsl(318, 70%, 50%)",
              "donut": 164,
              "donutColor": "hsl(323, 70%, 50%)"
            },
            {
              "country": "AM",
              "hot dog": 41,
              "hot dogColor": "hsl(304, 70%, 50%)",
              "burger": 197,
              "burgerColor": "hsl(264, 70%, 50%)",
              "sandwich": 109,
              "sandwichColor": "hsl(20, 70%, 50%)",
              "kebab": 197,
              "kebabColor": "hsl(233, 70%, 50%)",
              "fries": 144,
              "friesColor": "hsl(55, 70%, 50%)",
              "donut": 27,
              "donutColor": "hsl(237, 70%, 50%)"
            }
          ]
    return (
        <div
        style={{
            height: "100vh",
            width: "80%",
            margin: "auto",
            textAlign:"center",
            backgroundColor: "white",
            color: "black"
        }}
    >
       <Card>
        <div    
            style={{
                padding:"10px",

            }}
            >
            <Typography variant='h4'>About me.</Typography>
            <Typography variant='body'>Im a Software Engineer.</Typography>
        </div>
       </Card>
       <Card>
        <Typography variant='h4'>Career Pulse</Typography>
        <Typography variant='body'> I have a dashboard that showcase my career highlights below</Typography>
        <ResponsiveBar
        data={data}
        keys={[
            'hot dog',
            'burger',
            'sandwich',
            'kebab',
            'fries',
            'donut'
        ]}
        indexBy="country"
        margin={{ top: 50, right: 130, bottom: 50, left: 60 }}
        padding={0.3}
        valueScale={{ type: 'linear' }}
        indexScale={{ type: 'band', round: true }}
        colors={{ scheme: 'nivo' }}
        defs={[
            {
                id: 'dots',
                type: 'patternDots',
                background: 'inherit',
                color: '#38bcb2',
                size: 4,
                padding: 1,
                stagger: true
            },
            {
                id: 'lines',
                type: 'patternLines',
                background: 'inherit',
                color: '#eed312',
                rotation: -45,
                lineWidth: 6,
                spacing: 10
            }
        ]}
        fill={[
            {
                match: {
                    id: 'fries'
                },
                id: 'dots'
            },
            {
                match: {
                    id: 'sandwich'
                },
                id: 'lines'
            }
        ]}
        borderColor={{
            from: 'color',
            modifiers: [
                [
                    'darker',
                    1.6
                ]
            ]
        }}
        axisTop={null}
        axisRight={null}
        axisBottom={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'country',
            legendPosition: 'middle',
            legendOffset: 32,
            truncateTickAt: 0
        }}
        axisLeft={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'food',
            legendPosition: 'middle',
            legendOffset: -40,
            truncateTickAt: 0
        }}
        labelSkipWidth={12}
        labelSkipHeight={12}
        labelTextColor={{
            from: 'color',
            modifiers: [
                [
                    'darker',
                    1.6
                ]
            ]
        }}
        legends={[
            {
                dataFrom: 'keys',
                anchor: 'bottom-right',
                direction: 'column',
                justify: false,
                translateX: 120,
                translateY: 0,
                itemsSpacing: 2,
                itemWidth: 100,
                itemHeight: 20,
                itemDirection: 'left-to-right',
                itemOpacity: 0.85,
                symbolSize: 20,
                effects: [
                    {
                        on: 'hover',
                        style: {
                            itemOpacity: 1
                        }
                    }
                ]
            }
        ]}
        role="application"
        ariaLabel="Nivo bar chart demo"
        barAriaLabel={e=>e.id+": "+e.formattedValue+" in country: "+e.indexValue}
    />
       </Card>

    </div>
    )
}
